import React from 'react';
import { Navigate } from "react-router-dom"

function Dashboard({ authorized }) {

    if (!authorized) {
        return (
        <Navigate to="/login"/>
        )
    }
    return(
        <div>Hello Dashboard</div>
    )
}

export default Dashboard;
